import React from 'react';


const About = () => {

    return (
        <div className="section about">
            <h1 className="section-title">_ Hello there! :) _</h1>
            <div className="about-content">
                My name is Collin Sparks! I am having a great time working with
                Python and JavaScript and whatever other techs I come across and
                end up needing to learn in order to do my thing.
            </div>
        </div>
    );
};

export default About;
